              ffi.Pointer<gchar>,
              ffi.Pointer<ffi.Pointer<gchar>>,
              ffi.Pointer<ffi.Pointer<gchar>>,
              gpointer,
              ffi.Pointer<ffi.Pointer<GError>>)>> start_element;

  external ffi.Pointer<
